import logo from './logo.svg';
import './App.css';
import Home from "./components/Home";


function App() {
  return (
    <div className="App">
      <Navbar/>
      <Home></Home>
      <Campus></Campus>
      <Students></Students>
    </div>
  );
}

export default App;


